import React from 'react'
import ImageSlider from './ImageSlider';

export default function Slideshow () {
    return (
    <div>

        <header>
            <h1>Slideshow Page :P</h1>
        </header>

        <body>
            <ImageSlider/>
        </body>

    </div>
    );
}
